#[derive(Copy, Clone, PartialEq, Eq, Debug)]
pub struct Release<'a> {
    pub kind: &'a str,
    pub version: Version,
    pub os: &'a str,
    pub architecture: &'a str,
    pub build_configuration: &'a str,
    pub checksum: &'a str,
    pub url: &'a str,
}

impl Release<'static> {
    #[allow(dead_code)]
    const fn new(
        kind: &'static str,
        version: Version,
        os: &'static str,
        architecture: &'static str,
        build_configuration: &'static str,
        checksum: &'static str,
        url: &'static str,
    ) -> Self {
        Self {
            kind,
            version,
            os,
            architecture,
            build_configuration,
            checksum,
            url,
        }
    }
}

impl Display for Release<'_> {
    fn fmt(&self, f: &mut std::fmt::Formatter<'_>) -> std::fmt::Result {
        write!(
            f,
            "{}-{}-{}-{}-{}",
            self.kind, self.version, self.os, self.architecture, self.build_configuration
        )
    }
}
